// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate, useLocation } from 'react-router-dom';
import { Box } from '@mui/material'; // Import Box from Material-UI
import Sidebar from './components/Sidebar';
import Dashboard from './components/Dashboard';
import TutoringHistory from './components/TutoringHistory';
import UpcomingSessions from './components/UpcomingSessions';
import StudyMaterials from './components/StudyMaterials';
import Settings from './components/Settings';
import PersonalDetails from './components/PersonalDetails'; // Import the PersonalDetails component
import Notes from './components/Notes'; // Create this component
import AIQuiz from './components/AIQuiz'; // AI Quiz component
import PastPapers from './components/PastPapers'; // Create this component
import Flashcards from './components/Flashcards'; // Create this component
import FormulaSheets from './components/FormulaSheets'; // Create this component
import PaymentSession from './components/PaymentSession';
import PasswordReset from './components/PasswordReset';
import AdminDashboard from './components/AdminDashboard';
import AdminLogin from './components/AdminLogin';
import StudentLogin from './components/StudentLogin';
import ProtectedRoute from './components/ProtectedRoute'; // Import the ProtectedRoute component
import AdminProtectedRoute from './components/AdminProtectedRoute'; // Import the AdminProtectedRoute component
import { AuthProvider } from './context/AuthContext'; // Import the AuthProvider

function App() {
  return (
    <AuthProvider>
      <Router>
        <MainLayout />
      </Router>
    </AuthProvider>
  );
}

const MainLayout = () => {
  const location = useLocation(); // Hook to get the current route

  // Check if the current route is a login page or an admin page
  const isLoginPage = location.pathname === '/student-login' || location.pathname === '/admin-login';
  const isAdminPage = location.pathname.startsWith('/admin'); // Hide sidebar for all admin-related pages

  return (
    <div style={{ display: 'flex', minHeight: '100vh' }}>
      {/* Conditionally render Sidebar only when not on login or admin pages */}
      {!isLoginPage && !isAdminPage && <Sidebar />}
      <Box component="main" sx={{ flexGrow: 1, p: 3, backgroundColor: '#2c2c2c', color: '#fff' }}>
        <Routes>
          {/* Admin and Student Routes */}
          <Route path="/admin-login" element={<AdminLogin />} />
          <Route path="/admin-dashboard" element={<AdminProtectedRoute element={<AdminDashboard />} />} />
          <Route path="/student-login" element={<StudentLogin />} />

          {/* Protected Routes for Students */}
          <Route path="/dashboard" element={<ProtectedRoute element={<Dashboard />} />} />
          <Route path="/tutoring-history" element={<ProtectedRoute element={<TutoringHistory />} />} />
          <Route path="/upcoming-sessions" element={<ProtectedRoute element={<UpcomingSessions />} />} />
          <Route path="/study-materials" element={<ProtectedRoute element={<StudyMaterials />} />} />
          <Route path="/settings" element={<ProtectedRoute element={<Settings />} />} />
          <Route path="/personal-details" element={<ProtectedRoute element={<PersonalDetails />} />} />
          <Route path="/notes" element={<ProtectedRoute element={<Notes />} />} />
          <Route path="/ai-quiz" element={<ProtectedRoute element={<AIQuiz />} />} />
          <Route path="/past-papers" element={<ProtectedRoute element={<PastPapers />} />} />
          <Route path="/flashcards" element={<ProtectedRoute element={<Flashcards />} />} />
          <Route path="/formula-sheets" element={<ProtectedRoute element={<FormulaSheets />} />} />
          <Route path="/payment-session" element={<ProtectedRoute element={<PaymentSession />} />} />

          {/* Default Route Redirects to Student Login */}
          <Route path="/" element={<Navigate to="/student-login" />} />
        </Routes>
      </Box>
    </div>
  );
};

export default App;
